css:
.git-log {
  overflow: auto;
  font-family: Inconsolata, Monaco, Consolas, 'Courier New', Courier;
  background-color: #1d1f21;
  color: #c5c8c6;
  display: flex;
  flex-direction: column;
}
.git-log h2 {
  margin: 0px;
  font-family: inherit;
  font-size: 1.1em;
}
.git-log p {
  margin: 0px;
  line-height: inherit;
  padding: 0 1em;
}
.git-log .panels {
  display: -webkit-flex;
  -webkit-flex-direction: row;
  overflow: auto;
}
.git-log .main {
  white-space: nowrap;
}
.git-log .main h2 {
  border-bottom: rgba(255, 255, 255, 0.5) 1px solid;
  background-color: rgba(0, 0, 0, 0.3);
  padding: 10px 0;
  text-align: center;
}
.git-log .main p {
  position: relative;
}
.git-log .main p:nth-child(odd) {
  background: rgba(0, 0, 0, 0.3);
}
.git-log .main p span {
  overflow: hidden;
  text-overflow: ellipsis;
  display: block;
}
.git-log .main .list,
.git-log .main .list-head {
  position: relative;
  text-align: left;
  margin: 0 -0.95em;
}
.git-log .info {
  flex-basis: 35%;
  flex-direction: column;
  flex-shrink: 0;
  position: relative;
  background-color: rgba(0, 0, 0, 0.6);
}
.git-log .info h2 {
  text-align: left;
  line-height: inherit;
  padding: 0 1em;
  flex-shrink: 0;
  border: none;
  background: none !important;
  font-size: 1em;
  font-weight: bold;
}
.git-log .info h2:first-child {
  padding-top: 0.5em;
}
.git-log .info h2 span {
  font-weight: normal;
  font-size: 1em;
  padding-left: 8px;
}
.git-log .info p {
  padding-top: 1em;
  margin-bottom: 0.5em;
  background: none !important;
  flex-shrink: 0;
}
.git-log .info-data {
  border-top: solid 5px rgba(0, 0, 0, 0.3);
  position: relative;
  flex-shrink: 0;
}
.git-log .info-image {
  position: absolute;
  top: 0.5em;
  right: 1em;
}
.git-log .info-image img {
  width: 64px;
}
.git-log .info-image img:first-child {
  margin-right: 1px;
}
.git-log .info-file {
  display: flex;
  flex-shrink: 0;
  border-top: solid 1px;
  margin-top: 1em;
}
.git-log .info-file .list-head {
  border-bottom: solid 1px;
  margin: 0 -0.95em;
}
.git-log .info-file .column {
  text-align: left;
}
.git-log .column {
  text-align: center;
  flex: 1 0;
  padding: 0 1em;
}
.git-log .graph {
  z-index: 2;
  flex: 0 0 auto !important;
}
.git-log svg {
  margin: 0 1em;
}
.git-log .table {
  width: 100%;
  display: flex;
  flex: 1 0;
}
.git-log .comments {
  flex-basis: 70%;
}
.git-log .comments p::before,
.git-log .comments p::after {
  content: "";
  display: block;
  position: absolute;
  top: 0px;
  bottom: 0px;
  background: inherit;
}
.git-log .comments p::after {
  z-index: 4;
  opacity: 0;
}
.git-log .commit,
.git-log .date,
.git-log .author {
  flex-basis: 10%;
}
.git-log .commit p {
  padding-left: 1.5em;
}
.git-log .resize-handle {
  position: absolute;
  width: 10px;
  top: 0;
  bottom: 0;
  right: -5px;
  cursor: col-resize;
}
.git-log .added {
  background: url(atom://git-log/resources/added.png);
}
.git-log .deleted {
  background: url(atom://git-log/resources/deleted.png);
}
.git-log .modified {
  background: url(atom://git-log/resources/modified.png);
}
